import React, { useState, useEffect } from "react";
import axios from "axios";
import LandPadItem from "./LandPadItem";
const Landpads = () => {
  const [data, setData] = useState([]);
  const fetchData = () => {
    axios.get("https://api.spacexdata.com/v4/landpads").then((res) => {
      console.log(res.data.id);
      setData(res.data);
    });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div className="container my-5">
      <h1 className="my-5 mb-0 text-light card-title" style ={{marginTop: "100px" }}>Landpads</h1>
      <div className="row">
        {data.map((data) => {
          return (
            <div className="col-sm-4" key={data.id}>
              <LandPadItem
                key={data.id}
                name={data.name}
                full_name={data.full_name}
                status={data.status}
                images={data.images.large}
                details={data.details}
                id = {data.id}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Landpads;
